.Nav-bar {
  display: flex;
  height: 5vmin;
  background-color: #ff7171;
  width: 100%;
}
.Nav-title {
  margin: 1vmin;
  font-size: 2vmin;
}

.home-page-main {
  display: grid;
  grid-template-columns: repeat(2, 50vmin);
  width: 75%;
  /*border: 1px solid black;*/
  margin-left: 12%;
  margin-top: 5%;
  padding-left: 5vmin;
  
}
.register {
  text-align: center;
  margin: 5%;
  height: 90%;
}
.form-label {
  text-align: left;
  display: block;
  font-size: 2.5vmin;
}
.input-form {
  margin-top: 2%;
  margin-bottom: 2%;
  height: 4vmin;
  width: 39.7vmin;
  display: block;
  border: 1px solid c7cccb;
  font-size: 2vmin;
}
.home-page-register {
  width: 45vmin;
  border: 1px solid black;
  background-color: white;
  border-radius: 16px;
}
.home-page-main-photo {
  width: 45vmin;
  /*border: 1px solid black;*/
}
.home-photo {
  margin-top: 2%;
  height: 50vmin;
  width: 100vmin;
  border-radius: 10px;
  border: 5px solid white;
}
.register-button {
  height: 5vmin;
  width: 40.7vmin;
  text-align: center;
  margin-top: 10%;
  font-size: 2.5vmin;
  border-radius: 8px;
  border: 0;
  color: #353535;
  background-color: #ff7171;
  cursor: pointer;
}
.forget-option {
  display: block;
  margin: 2%;
  margin-right: 1%;
  text-align: end;
  color: #888889;
  cursor: pointer;
  font-size: 1.7vmin;
}
.sign-up-option {
  margin-top: 10%;
  margin-left: 2%;
  text-align: center;
  color: #888889;
  cursor: pointer;
}
/*Default CSS code*/
.App {
  text-align: center;
  background-color: #353535;
  height: 1500px
}

.App-logo {
  height: 40vmin;
  pointer-events: none;
}

@media (prefers-reduced-motion: no-preference) {
  .App-logo {
    animation: App-logo-spin infinite 20s linear;
  }
}

.App-header {
  background-color: #282c34;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  font-size: calc(10px + 2vmin);
  color: white;
}

.App-link {
  color: #61dafb;
}

@keyframes App-logo-spin {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
}

.Nav-bar {
  display: flex;
  height: 5vmin;
  background-color: #ff7171;
  width: 100%;
}
.Nav-title {
  margin: 1vmin;
  font-size: 2vmin;
}

.home-page-main {
  display: grid;
  grid-template-columns: repeat(2, 50vmin);
  width: 75%;
  /*border: 1px solid black;*/
  margin-left: 12%;
  margin-top: 5%;
  padding-left: 5vmin;
  
}
.register {
  text-align: center;
  margin: 5%;
  height: 90%;
}
.form-label {
  text-align: left;
  display: block;
  font-size: 2.5vmin;
}
.input-form {
  margin-top: 2%;
  margin-bottom: 2%;
  height: 4vmin;
  width: 39.7vmin;
  display: block;
  border: 1px solid c7cccb;
  font-size: 2vmin;
}
.home-page-register {
  width: 45vmin;
  border: 1px solid black;
  background-color: white;
  border-radius: 16px;
}
.home-page-main-photo {
  width: 45vmin;
  /*border: 1px solid black;*/
}
.home-photo {
  margin-top: 2%;
  height: 50vmin;
  width: 100vmin;
  border-radius: 10px;
  border: 5px solid white;
}
.register-button {
  height: 5vmin;
  width: 40.7vmin;
  text-align: center;
  margin-top: 10%;
  font-size: 2.5vmin;
  border-radius: 8px;
  border: 0;
  color: #353535;
  background-color: #ff7171;
  cursor: pointer;
}
.forget-option {
  display: block;
  margin: 2%;
  margin-right: 1%;
  text-align: end;
  color: #888889;
  cursor: pointer;
  font-size: 1.7vmin;
}
.sign-up-option {
  margin-top: 10%;
  margin-left: 2%;
  text-align: center;
  color: #888889;
  cursor: pointer;
}
/*Default CSS code*/
.App {
  text-align: center;
  background-color: #353535;
  height: 1500px
}

.App-logo {
  height: 40vmin;
  pointer-events: none;
}

@media (prefers-reduced-motion: no-preference) {
  .App-logo {
    animation: App-logo-spin infinite 20s linear;
  }
}

.App-header {
  background-color: #282c34;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  font-size: calc(10px + 2vmin);
  color: white;
}

.App-link {
